export default function Form() {
  function handelrSubmit(e) {
    e.preventDefault();
  }
  return (
    <>
      <form
        className=" text-xl  py-10 px-10    grid  grid-cols-2 grid-row-2  gap-8  "
        onSubmit={(e) => handelrSubmit(e)}
      >
        <div className=" flex flex-col  ">
          <label htmlFor="firstName">Your Fist Name</label>
          <input  className="  text-b   " id="firstName" type="text" />
        </div>
        <div className=" flex flex-col   ">
          <label htmlFor="listName">Your List Name</label>
          <input className="group int" id="listName" type="text" />
        </div>
        <div className=" flex flex-col  ">
          <label htmlFor="firstName">Your Fist Name</label>
          <input className=" group int" id="firstName" type="password" />
        </div>
        <div className=" flex flex-col  ">
          <label htmlFor="listName">Your List Name</label>
          <input id="listName" type="date" />
        </div>
      </form>
    </>
  );
}
